function genera_nif(){var r=Math.floor(1e8*Math.random());return pad(r.toString(),8)+calcula_letra(r)}function genera_nie(){var r=Math.floor(3*Math.random()),t=Math.floor(1e7*Math.random()),a=calcula_letra(pad(parseInt(r.toString()+pad(t.toString(),7),10),8));return"XYZ".charAt(r)+pad(t.toString(),7)+a}function genera_cif(){var r="ABCDEFGHJNPQRSUVW";r=r.charAt(Math.floor(17*Math.random()));var t=Math.floor(100*Math.random()),a=Math.floor(1e5*Math.random()),n=r+pad(t.toString(),2)+pad(a.toString(),5);return n+calcula_control_cif(n)}function genera_custom_cif(r){var t=Math.floor(100*Math.random()),a=Math.floor(1e5*Math.random()),n=r+pad(t.toString(),2)+pad(a.toString(),5);return n+calcula_control_cif(n)}function calcula_letra(r){return"TRWAGMYFPDXBNJZSQVHLCKE".charAt(r%23)}function calcula_control_nifnie(r){n=null;try{var t=r.substr(0,1);if(-1!=="XYZ".indexOf(t)){var a="XYZ".indexOf(t);return n=pad(parseInt(a.toString()+r.substr(1,r.length-1),10),8),isNaN(n)?null:calcula_letra(n)}if(-1==="KLM".indexOf(t))return n=parseInt(r,10),isNaN(n)?null:calcula_letra(n);var n=pad(parseInt(0+r.substr(1,r.length-1),10),8);return calcula_letra(n)}catch(r){return null}}function calcula_control_cif(r){var t=r.substr(1,r.length-1),a=0,n=0;for(n=1;n<t.length;n+=2)a+=parseInt(t.substr(n,1));var e=0;for(n=0;n<t.length;n+=2){var l=2*parseInt(t.substr(n,1));1==String(l).length?e+=parseInt(l):e=e+parseInt(String(l).substr(0,1))+parseInt(String(l).substr(1,1))}var o=10-(a+=e)%10,s=r.substr(0,1).toUpperCase();return s.match(/^[PQRSNW]$/)?String.fromCharCode(64+o).toUpperCase():s.match(/^[ABCDEFGHJUV]$/)?(10==o&&(o=0),o):calcula_letra(r)}function calcula_control_otros_nif(r){var t=r.substr(1,r.length-1),a=0,n=0;for(n=1;n<t.length;n+=2)a+=parseInt(t.substr(n,1));var e,l=0;for(n=0;n<t.length;n+=2){var o=2*parseInt(t.substr(n,1));1==String(o).length?l+=parseInt(o):l=l+parseInt(String(o).substr(0,1))+parseInt(String(o).substr(1,1))}e=10<(a+=l)?String(a).substr(1,1):a;return["J","A","B","C","D","E","F","G","H","I"][e=10-parseInt(e)]}